import * as React from "react";
import Card from "@mui/material/Card";
import CardComponent from "./CardComponent2";
import CardContent from "@mui/material/CardContent";
import Typography from "@mui/material/Typography";
import Avatar from "@mui/material/Avatar";
import { Grid } from '@mui/material';
import Box from '@mui/material/Box';
import Img from "../src/images/x-circle.svg";
// import CancelOutlinedIcon from '@mui/icons-material/CancelOutlined';
import {
  Button,
  CardActionArea,
  CardActions,
  CardHeader,
  TextField,
} from "@mui/material";


function Item(props) {
    const { sx, ...other } = props;
    return (
        <Box
            sx={{
                display: 'flex',
                p: 1,
                m: 1,
                bgcolor: '#101010',
                color: 'grey.300',
                border: '1px solid',
                borderColor: 'grey.800',
                borderRadius: 2,
                fontSize: '0.875rem',
                fontWeight: '700',
                ...sx,
            }}

        />
    );
}


export default function MultiActionAreaCard() {
  return (
    <Card sx={{ width: 550, height: 500 }}>
      <CardActionArea>
        <CardHeader
          sx={{
            backgroundColor: "#d3d3d3",
            height: 70,
          }}
          title={
            <Typography
              sx={{ fontWeight: "bolder", mb: 1, fontSize: "3  vh", mt: 1 }}
            >
              {" "}
              Create a Document
            </Typography>
          }
          action={
            <Avatar
              src={Img}
              sx={{
                marginLeft: "auto",
                height: "3vh",
                width: "3vh",
                mb: 2,
                marginTop: "2vh",
                mr: 2,
              }}
            />
          }
        />
        <CardContent>
          <Typography
            gutterBottom
            component="p"
            color="textSecondary"
            sx={{ mb: 3, mt: 2, fontSize: "small" }}  >
            Select one or more document types you'd like to process in this
            workspace.You can add more later.
          </Typography>


          <div style={{ width: '100%' }}>
            <Box
                sx={{
                    display: 'flex',
                    justifyContent: 'flex-start',
                    p: 1,
                    m: 1,
                    bgcolor: 'background.paper',
                    borderRadius: 1,
                }}
            >
                <Item>Item 1</Item>
                <Item>Item 2</Item>
                <Item>Item 3</Item>
            </Box>
            </div>

          <div>
            <Typography sx={{ fontWeight: "bolder", mb: 1, fontSize: "small" }}>
              {" "}
              Workspace Name
            </Typography>
            <TextField
              id="outlined-basic"
              variant="outlined"
              fullWidth
              size="small"
            />
          </div>







        </CardContent>
      </CardActionArea>
      <CardActions>
        <Button
          variant="contained"
          size="large"
          sx={{
            backgroundColor: "#9F77EB",
            fontSize: "small",
            fontWeight: "bold",
            textTransform: "none",
            ml: 1,
            ":hover": {
              bgcolor: "#9F77EB",
              color: "white",
            },
          }}
        >
          Create Documents
        </Button>
      </CardActions>
    </Card>
  );
}
